import React from 'react'
import './Slider.css';

const Slider = ({children,styles,wraperStyle}) => {
  return (
    <>
    <div className="wraper_container" style={styles}>
        <div className="wraper" style={wraperStyle}>
        {/* <div className="item"> */}
        {children}
        {/* </div>         */}
        </div>
    </div>
    </>
  )
}

export default Slider;
